CREATE TABLE jf_exam.student
(
    id char(32) PRIMARY KEY NOT NULL,
    student_id varchar(255),
    name varchar(255),
    mail varchar(255),
    id_card_no char(18),
    telephone char(11),
    password char(32),
    last_login_time bigint(20),
    school_id char(32),
    classroom_id char(32),
    last_login_ip char(15),
    createtime bigint(20),
    modifytime bigint(20),
    role_id varchar(36),
    gender int(11)
);
